  Description
-------------------------------------------------------------------------------------------------
  SUMMARY: Use this script to insert default data into table BaBank. The following settings are
           important to use:
           
           First goto Klibu and update database data with KiSS software
           
           To find only the active ones from sic
           - WHERE SicUpdated = 1
               AND ClearingNrNeu IS NULL
           
           To better find changes of data
           - ORDER BY BaBankID
           
           Last used database:
           KiSS_BSS_Dev on CHBEHVS004
           
  INFO:    For further details see: 
           http://www.six-interbank-clearing.com/de/tkicch_onlineservices_downloadbcbankmasterdata.htm
  
  TEST:    SELECT *
           FROM dbo.BaBank
           WHERE SicUpdated = 1
             AND ClearingNrNeu IS NULL
           ORDER BY BaBankID;
